import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './components/Home';
import Portfolio from './components/Portfolio';
import ResumeAndCertificates from './components/ResumeAndCertificates';
import AboutMe from './components/AboutMe';
import Contact from './components/Contact';
import Skills from './components/Skills';
import Services from './components/Services';
import NavbarCasual from './components/NavBar/NavbarCasual';
import NavbarProfessional from './components/NavBar/NavbarProfessional';

import './App.css';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/Casual/*" element={<LayoutWithNavbar navbar={<NavbarCasual />} />}>
          <Route path="/" element={<Home />} />
          <Route path="ResumeAndCertificates" element={<ResumeAndCertificates />} />
          <Route path="Portfolio" element={<Portfolio />} />
          <Route path="aboutMe" element={<AboutMe />} />
          <Route path="Contact" element={<Contact />} />
        </Route>
        <Route path="/Professional/*" element={<LayoutWithNavbar navbar={<NavbarProfessional />} />}>
          <Route path="/" element={<Home />} />
          <Route path="Portfolio" element={<Portfolio />} />
          <Route path="Services" element={<Services />} />
          <Route path="Skills" element={<Skills />} />
          <Route path="Contact" element={<Contact />} />
        </Route>
      </Routes>
    </Router>
  );
};

const LayoutWithNavbar = ({ navbar, children }) => {
  return (
    <div>
      {navbar}
      {children}
    </div>
  );
};

export default App;
